import "./HeadersStyles/Headers.scss";
function Headers() {
  return (
    <div className="headers">
      <div>#</div>
      <div>Coin</div>
      <div></div>
      <div>Price</div>
      <div>1h</div>
      <div>24h</div>
      <div>7d</div>
      <div>24h Volume</div>
      <div>Mkt Cap</div>
      <div>Last 7 Days</div>
    </div>
  );
}

export default Headers;
